import React from 'react';

function Services() {
  const services = [
    { id: 1, title: "Geología", description: "Estudios geológicos y análisis de suelos." },
    { id: 2, title: "Hidrología", description: "Investigación y gestión de recursos hídricos." },
    { id: 3, title: "Meteorología", description: "Predicción del clima y estudios meteorológicos." },
    { id: 4, title: "Cartografía", description: "Mapeo y análisis espacial." }
  ];

  return (
    <div>
      <h2>Servicios</h2>
      <div className="row">
        {services.map(service => (
          <div key={service.id} className="col-md-4">
            <div className="card mb-4">
              <div className="card-body">
                <h5 className="card-title">{service.title}</h5>
                <p className="card-text">{service.description}</p>
              </div>
            </div>
          </div>
        ))}
      </div>
    </div>
  );
}

export default Services;
